tables.table_schema:
CREATE TABLE managers (
  manager_id INT PRIMARY KEY,
  manager_name VARCHAR(100),
  department VARCHAR(100),
  experience_years INT
);

CREATE TABLE contributions (
    id INT PRIMARY KEY,
    account_id INT,
    contribution_amount DECIMAL,
    date_of_contribution DATE
);

CREATE TABLE withdrawals (
    id INT PRIMARY KEY,
    account_id INT,
    withdrawal_amount DECIMAL,
    date_of_withdrawal DATE
);

CREATE TABLE investment_growth (
    id INT PRIMARY KEY,
    account_id INT,
    growth_percentage DECIMAL,
    date_of_growth DATE
);

CREATE TABLE contribution_table (
  account_id INT,
  amount DECIMAL,
  timestamp TIMESTAMP
);

CREATE TABLE withdrawal_table (
  account_id INT,
  amount DECIMAL,
  timestamp TIMESTAMP
);

CREATE TABLE investment_table (
  account_id INT,
  amount DECIMAL,
  timestamp TIMESTAMP
);

CREATE TABLE account_info_table (
  account_id INT,
  client_name VARCHAR(50),
  balance DECIMAL
);

CREATE TABLE IF NOT EXISTS Contributions (
    contribution_id INT PRIMARY KEY,
    account_id INT,
    amount DECIMAL(10,2),
    contribution_date DATE
);

CREATE TABLE IF NOT EXISTS Withdrawals (
    withdrawal_id INT PRIMARY KEY,
    account_id INT,
    amount DECIMAL(10,2),
    withdrawal_date DATE
);

CREATE TABLE IF NOT EXISTS InvestmentGrowth (
    growth_id INT PRIMARY KEY,
    account_id INT,
    growth_rate DECIMAL(5,2),
    growth_date DATE
);

CREATE TABLE IF NOT EXISTS Managers (
    manager_id INT PRIMARY KEY,
    manager_name VARCHAR(50),
    email VARCHAR(50),
    phone_number VARCHAR(15)
);
